import React from 'react'
import {Route} from 'react-router-dom'
import {connect} from 'react-redux'
import {createStructuredSelector} from 'reselect'
import Spinner from '../../component/spinner/spinner.component'
import {Â selectCurrentUser} from '../../redux/user/user.selector'
import './contact.styles.scss'

const ContactPage = ({currentUser}) => (
  <div className='contact'>
    {
      currentUser? (
        <div>
          <h1 className='title'>Contact Crown Cloth</h1>
          <h2>Silicon Valley</h2>
          <h3>contact@crown.com</h3>
          <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d202845.11502794272!2d-122.18118079947892!3d37.402720920859565!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x808fb68ad0cfc739%3A0x7eb356b66bd4b50e!2sSilicon%20Valley%2C%20CA%2C%20USA!5e0!3m2!1sen!2sid!4v1606556783843!5m2!1sen!2sid" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>
        </div>

        ) :
      <h1>Pls Sign In</h1>
    }
  </div>
)

const mapStateToProps = createStructuredSelector({
  currentUser:selectCurrentUser
})

export default connect(mapStateToProps)(ContactPage);
